# AllStats_tb_v9.0.pl -- 12Dec2014
#
# Code is based largely on that of AllStats_tb_v8.1
#
# Modifications:
#	--t test eliminated
#	--resampling on ratio
#	--requires an input file containing the sample count files rather than
#		 listing on command line
#	--gives mean counts/TA for all libraries as well as control/treatment means
#	--uses total counts/TAs hit for normalization (i.e., v8.0)
#	--retains manual normalization option
#	--improved volcano plot (uses color for Qval â‰¤ 0.05)
#
# version 9.1 uses total count normalization (also includes manual option)
#
# version 9.2.0 uses resampling with replacement for treatment and control
#	counts separately and reports mean difference; pval based on number of
#	trials with difference > zero
#
# version 9.3 incorporates the normalization options from v10.1 (orf counts)
#	reverts to using permutation for resampling
#	also adds ratio plot from v10.1.1
#	REB 07Aug2015
#
# version 9.3.1 adds ECDF plot
#
# version 9.3.2 adds qq plots
#
# version 9.3.3 adds "mm3" normalization
# In mm3 the geometric mean of all samples is used as the denominator for the
# mode matching (instead of control sample 1).
#
# Fixed bug in the original mm normalization that resulted in a crash if the
# reference control library was also included as a treatment library, which
# could occur when testing control vs. control configurations (rare!). This
# would cause the ratios to be all zeros and NaN's, which would crash the
# density function since only non-zero values are passed to the density
# function. Now, the ratio vector is tested for non-zero elements. Zeros are not
# removed unless there are at least 500 non-zero values from which to calculate
# the density. This will be the case for virtually all "real" comparisons.
#
# Fixed bug in ecdf plotting with > 7 libraries.
# Changed volcano plot; now plots -log(Pvals) instead of -log(Qvals)
#
use strict;
use List::Util 'sum';
use List::MoreUtils qw(firstidx all true);
use Statistics::R;
our $version = 'v9.3.3';
my $time = localtime;
die "usage: AllStats_tb_$version.pl <orf table2 file> <basename for output> <config_file.txt>\nraw.txt files must include zero counts!\n"
	unless (@ARGV == 3);
### check for input files
my $table_file = shift @ARGV;
my $basename = shift @ARGV;
die "Can't find $table_file! ($!)\n"
	unless (-e $table_file);
die "Can't find config_file! ($!)\n"
	unless (-e $ARGV[0]);
my (@cont_files, @treat_files);
while (<>) {
	chomp;
	my @line = split /\t/, $_;
	if ($line[1]) {
		push @treat_files, $line[0];
	} elsif ($line[1] == 0) {
		push @cont_files, $line[0];
	} else {
		die "Expecting '1' or '0'! Check config_file.txt.\n";
	}
}
my @all_files = (@cont_files, @treat_files),
my $n_cont = @cont_files;
my $n_treat = @treat_files;
my $n_all = $n_cont + $n_treat;
my @indx = 0..$n_all - 1;
if ($n_cont < 1) { die "Must have at least 1 control file(s)!\n"; }
if ($n_treat < 1) { die "Must have at least 1 treatment file(s)!\n"; }
foreach (@all_files) {
	die "Can't find $_! ($!)\n" unless (-e $_);
}
my @sample_names = @all_files;
foreach (@sample_names) { # strip raw_templates.txt
	$_ =~ s/_raw.*$//;
}
my $temptag = int(rand 1000000);
### generate count table, track zeros in each library
system "paste @all_files > $temptag.temp0";
open IN, "$temptag.temp0"
	or die "Problem opening $temptag.temp0 for reading ($!)\n";
open OUT, ">$basename\_counts_raw.txt"
	or die "Problem opening $basename\_counts_raw.txt for writing ($!)\n";
print OUT "Coord\t" . (join "\t", @sample_names) . "\n"; # output file header
open ZEROS, ">$basename\_missed_TAs.txt"
	or die "Problem opening $basename\_missed_TAs.txt for writing ($!)\n";
print ZEROS "# TAs not hit in any library\n";
<IN>; #throw away header (not needed if input files lack header)
my (@data, $TA_count, @counts_this_TA, @TAs_hit, @total_hits, @zeros, $all_zeros);
while (<IN>) {
	chomp;
	@data = split /\t/;
	$TA_count++;
	@counts_this_TA = ();
	print OUT "$data[0]\t";
	for (my $i = 1; $i < 2 * $n_all; $i += 2) {
		push @counts_this_TA, $data[$i];
	}
	print OUT (join "\t", @counts_this_TA) . "\n";
	foreach (@indx) {
		$total_hits[$_] += $counts_this_TA[$_];
		if ($counts_this_TA[$_] == 0) {
			$zeros[$_]++;
		} else {
			$TAs_hit[$_]++; # overkill to track both, but minimal computation
		}
	}
	if (sum(@counts_this_TA) == 0) { # no TA hit!
		print ZEROS "$data[0]\n";
		$all_zeros++;
	}
}
close IN;
close OUT;
close ZEROS;
# data check
foreach (@indx) {
	unless ($zeros[$_] + $TAs_hit[$_] == $TA_count) {
		die "Something doesn't add up!\nZeros + TAs hit don't equal total TAs in library $sample_names[$_].\n";
	}
}
# report counts
my $phi = $all_zeros / $TA_count;
print "$TA_count TAs reported\n";
foreach (@indx) {
	printf "%g (%.2f%%) TAs not hit in $sample_names[$_]\n", $zeros[$_], $zeros[$_] / $TA_count * 100;
}
printf "%g (%.2f%%) TAs not hit in any library\n", $all_zeros, $all_zeros / $TA_count * 100;
print "Non-hit TAs listed in $basename\_missed_TAs.txt\n";
printf "Using %.4f as non-hit probability in E-V calculation\n", $phi;
###############################################################################
###################### normalizaton from v10.1 ################################
### choose normalization option here (TC, TCadj, TMM, DESeq, MM, MM3, man, noStats)
#my $norm_option = 'noStats';
my $norm_option = 'MM3';
### generate table of ORF counts for normalization
my $orf_count_file = orf_count_table(\@all_files, \@sample_names, $table_file, $basename);
my (@factors, @tot_cnt_fact, @TCadj_fact, @DESeq_fact, @TMM_fact, @ModeMatch_fact, @ModeMatch3_fact, $normRef);
### instantiate R
my $R = Statistics::R->new();
### calculate factors using all methods except manual
print "Calculating normalization factors...\n";
my $filename = $orf_count_file;
# DESeq
$R->set('file', $filename);
$R->run(q`countsTable <- read.table(file, header=T, row.names=1)`);
$R->run(q`library(DESeq)`);
$R->run(q`data <- data.matrix(countsTable)`);
$R->run(q`fact <- 1/estimateSizeFactorsForMatrix(data)`);
$R->run(q`fact <- as.numeric(fact)`);
$normRef = $R->get('fact');
@DESeq_fact = @{$normRef};
# TMM
$R->run(q`library(NOISeq)`);
$R->run(q`data <- data.matrix(countsTable)`);
$R->run(q`tm <- tmm(data)`); # relative lib sizes
$R->run(q`fact <- colSums(tm)/colSums(data)`);
$R->run(q`fact <- as.numeric(fact/mean(fact))`);
$normRef = $R->get('fact');
@TMM_fact = @{$normRef};
# total count
$R->run(q`sums <- colSums(countsTable)`);
$R->run(q`max <- max(sums)`);
$R->run(q`fact <- max/sums`);
$R->run(q`fact <- as.numeric(fact/mean(fact))`);
$normRef = $R->get('fact');
@tot_cnt_fact = @{$normRef};
# NZmeanSat ala Michael
# must first calculate saturation
$R->run(q`nz<-function(x){sum(x>0)/length(x)}`);
$R->run(q`sat <- apply(countsTable, 2, nz)`);
$R->run(q`nz.mean<-function(x){mean(x[x>0],trim=0.05)}`);
$R->run(q`exp <- apply(countsTable, 2, nz.mean) * sat`);
$R->run(q`fact <- max(exp)/exp`);
$R->run(q`fact <- as.numeric(fact/mean(fact))`);
$normRef = $R->get('fact');
@TCadj_fact = @{$normRef};
# emperical mode matching
$R->run(q`center<-function(x){if(sum(x>0, na.rm=T)>500){x<-x[x!=0]};dens<-density(x,na.rm=T);max<-dens$x[dens$y==max(dens$y)];max<-max(max);return(max)}`);
$R->run(q`ratios <- log(countsTable/countsTable[,1])`);
$R->run(q`modes <- apply(ratios[,2:ncol(ratios)], 2, center)`);
$R->run(q`modes <- c(0, modes)`);
$R->run(q`fact <- 1/exp(modes)`);
$R->run(q`fact <- as.numeric(fact/mean(fact))`);
$normRef = $R->get('fact');
@ModeMatch_fact = @{$normRef};
# mode matching 3
$R->run(q`center<-function(x){x<-x[x!=0];dens<-density(x,na.rm=T);max<-dens$x[dens$y==max(dens$y)];max<-max(max);return(max)}`);
$R->run(q`gm_mean <- function(x){exp(sum(log(x)) / length(x))}`);
$R->run(q`gm <- apply(countsTable+1,1,function(x) gm_mean(x))`);
$R->run(q`ratios <- log(countsTable/gm)`);
$R->run(q`modes <- apply(ratios, 2, center)`);
$R->run(q`fact <- 1/exp(modes)`);
$R->run(q`fact <- as.numeric(fact/mean(fact))`);
$normRef = $R->get('fact');
@ModeMatch3_fact = @{$normRef};
# output results
printf "TC factors:" . "\t%.4f" x @tot_cnt_fact . "\n", @tot_cnt_fact;
printf "TCadj factors:" . "\t%.4f" x @TCadj_fact . "\n", @TCadj_fact;
printf "TMM factors:" . "\t%.4f" x @TMM_fact . "\n", @TMM_fact;
printf "DESeq factors:" . "\t%.4f" x @DESeq_fact . "\n", @DESeq_fact;
printf "MM factors:" . "\t%.4f" x @ModeMatch_fact . "\n", @ModeMatch_fact;
printf "MM3 factors:" . "\t%.4f" x @ModeMatch3_fact . "\n", @ModeMatch3_fact;
if ($norm_option eq 'man') {
	print "Manual normalization chosen.  Be certain to hard code your factors below!\n";
	# One factor for each library!
	foreach (@indx) {
		$factors[$_] = 1.0; # default
	}
	# assign factors here
	#@factors = (0.8813823, 1.3883758, 0.9712955, 0.7589464);
	printf "User-assigned factors:" . "\t%.4f" x @factors . "\n", @factors;
} elsif ($norm_option eq 'DESeq') {
	@factors = @DESeq_fact;
} elsif ($norm_option eq 'TMM') {
	@factors = @TMM_fact;
} elsif ($norm_option eq 'TC') {
	@factors = @tot_cnt_fact;
} elsif ($norm_option eq 'TCadj') {
	@factors = @TCadj_fact;
} elsif ($norm_option eq 'MM') {
	@factors = @ModeMatch_fact;
} elsif ($norm_option eq 'MM3') {
	@factors = @ModeMatch3_fact;
} else {
	unlink "$temptag.temp0";
	die "Specify normalization method to run full program\n"
}
print "Using $norm_option normalization\n";
###############################################################################
### output table of normalized counts
### load counts into %counts hash; values are references to anonymous arrays
open IN, "$basename\_counts_raw.txt"
	or die "Problem opening $basename\_counts_raw.txt! ($!)\n";
<IN>; #throw away column headings
open OUT, ">$basename\_normalized.txt"
	or die "Problem opening $basename\_normalized.txt for output! ($!) \n";
print OUT "Coord\t" . (join "\t", @sample_names) . "\n"; # header
my ($this_coord, %counts);
while (<IN>) {
	chomp;
	@data = split /\t/, $_;
	$this_coord = shift @data;
	foreach (@indx) {
		$counts_this_TA[$_] = $data[$_] * $factors[$_];
	}
	$counts{$this_coord} = [ @counts_this_TA ];
	print OUT "$this_coord\t" . (join "\t", @counts_this_TA) . "\n";
}
close IN;
close OUT;
print scalar(keys %counts), " coords in \%counts hash\n";
if (scalar (keys %counts) != $TA_count) {
	die "Disagreement between number of reported TAs and elements in \%counts hash!\nTerminating.\n";
}
my @rounded_factors;
foreach (@indx) {
	$rounded_factors[$_] = sprintf "%.4f", $factors[$_];
}
### output table of normalized counts
### load counts into %counts hash; values are references to anonymous arrays
open IN, "$basename\_counts_raw.txt"
	or die "Problem opening $basename\_counts_raw.txt! ($!)\n";
<IN>; #throw away column headings
open OUT, ">$basename\_normalized.txt"
	or die "Problem opening $basename\_normalized.txt for output! ($!) \n";
print OUT "Coord\t" . (join "\t", @sample_names) . "\n"; # header
my ($this_coord, %counts);
while (<IN>) {
	chomp;
	@data = split /\t/, $_;
	$this_coord = shift @data;
	foreach (@indx) {
		$counts_this_TA[$_] = $data[$_] * $factors[$_];
	}
	$counts{$this_coord} = [ @counts_this_TA ];
	print OUT "$this_coord\t" . (join "\t", @counts_this_TA) . "\n";
}
close IN;
close OUT;
### load R functions for gumbel, resampling
# gumbel <- function(phi, n, gap) {
#	EM <- 0.57721566
#	theta <- log(1/phi)
#	mean <- log(n*(1-phi), 1/phi)+EM/theta-0.5
#	sig <- sqrt(pi^2/6/theta^2+1/12)
#	beta <- sig*sqrt(6)/pi
#	mu <- mean-beta*EM
#	p <- 1-exp(-exp(-(gap-mu)/beta))
#	return(p)
# }
$R->run(q`gumbel<-function(phi,n,gap){EM<-0.57721566;theta<-log(1/phi);mean<-log(n*(1-phi),1/phi)+EM/theta-0.5;sig<-sqrt(pi^2/6/theta^2+1/12);beta<-sig*sqrt(6)/pi;mu<-mean-beta*EM;p<-1-exp(-exp(-(gap-mu)/beta));return(p);}`);
# resampling on ratio
#	resample <- function(c, t) {
#		len.c <- length(c)
#		len.t <- length(t)
#		pool <- c(c, t)
#		list <- 1:10000
#		for (i in 1:10000) {
#			pool <- sample(pool)
#			c <- pool[1:len.c]
#			t <- pool[-(1:len.c)]
#			mean.c <- (sum(c) + 1) / len.c
#			mean.t <- (sum(t) + 1) / len.t
#			list[i] <- log2(mean.t / mean.c)
#		}
#		return (list)
#	}
$R->run(q`resample <- function(c, t) { len.c <- length(c); len.t <- length(t); pool <- c(c, t); list <- 1:10000; for (i in 1:10000) { pool <- sample(pool); c <- pool[1:len.c]; t <- pool[-(1:len.c)]; mean.c <- (sum(c) + 1) / len.c; mean.t <- (sum(t) + 1) / len.t; list[i] <- log2(mean.t / mean.c)}; return (list)}`);
### now process orf by orf
#
my $ofh = select STDOUT;
$| = 1; # make STDOUT hot
select $ofh;
#
my $time = localtime;
print "computing statistics orf by orf...\n$time\tstart\n";
my $completed;
#
# output: ID, start, end, strand, TAs, TAs hit, gap, counts1/TA...countsN/TA, mean counts control, mean counts treat, log2ratio, Pval EV
#
# after stats, append Qval E-V, Pval/Qval resample
#
open TABLE, "$table_file"
	or die "Problem opening $table_file ($!)\n";
<TABLE>; #throw away header
open OUT, ">$temptag.temp0"
	or die "Can't open $temptag.temp0 for output! ($!)\n"; # original file no longer needed
open DEBUG, ">$basename\_debug.txt"
	or die "Can't open $basename\_debug.txt for output! ($!)\n"; # counts for each TA in orf
print DEBUG "# AllStats_tb_$version run $time\n";
system "mkdir -p $basename\_R"; # for R scripts to plot resampling results
my ($TAs_in_orf, $popTAs, $cont_sum, $treat_sum, $log2_ratio, $diff, $tail);
my (@TA_list, @EV_list, $gap, $EV_pVal, @cont_counts, @treat_counts, @Pvals_resample, @Pvals_EV, @resamples);
my (@counts_this_orf, @stripped_this_orf, @count_str, @strip_str);
# @counts_this_orf holds refs to TA count arrays; @stripped_this_orf is analogous but common zeros stripped
$R->run(q`options(warn=-1)`);
#$R->run(q`options(warn=0)`);
my $NA_flag; # set if no stats calculated
my $rejected_orfs = 0;
while (<TABLE>) {
	$NA_flag = 0;
	last if (/intergenic/);
	chomp;
	@data = split /\t/;
	if ($data[4] eq 'no TAs' || @data == 4) { # no TAs in orf
		$rejected_orfs++;
		$NA_flag = 1;
		print OUT "$data[0]\t$data[1]\t$data[2]\t$data[3]\t0\tNA\tNA\t";
		foreach (1..$n_all) { print OUT "NA\t"; }
		print OUT "NA\tNA\tNA\n";
	} else { # TAs present (though not necessarily populated!), so proceed
		$TAs_in_orf = $#data - 3;
		@TA_list = @data[4..$#data];
		@EV_list = ();
		$popTAs = $TAs_in_orf;
		foreach (@indx) { # initialize
			$counts_this_orf[$_] = [ ];
			$stripped_this_orf[$_] = [ ];
		}
		@count_str = ();
		@strip_str = ();
		foreach my $this_TA (@TA_list) {
			@counts_this_TA = @{ $counts{$this_TA} };
			foreach (@indx) {
				$count_str[$_] .= "$counts_this_TA[$_]:";
			}
			if (all { $_ == 0 } @counts_this_TA) { # no hits in any library at this TA
				$popTAs -= 1;
				push @EV_list, 0;
			} else {
				push @EV_list, 1;
				foreach (@indx) {
					$strip_str[$_] .= "$counts_this_TA[$_]:";
				}
			}
		}
		# convert strings to arrays, store reference
		foreach (@indx) {
			$count_str[$_] =~ s/:$//; # delete trailing ':'
			$strip_str[$_] =~ s/:$//;
			$counts_this_orf[$_] = [ split /:/, $count_str[$_] ];
			$stripped_this_orf[$_] = [ split /:/, $strip_str[$_] ];
		}
		####################### for debugging ######################
		my $out_string = '';
		foreach(0..$n_cont - 1) { # use @indx for consistency
			$out_string .=  (join "\t", _unpack(\@counts_this_orf, $_, $_)) . "\t\t";
		}
		$out_string =~ s/\t\t$//;
		print DEBUG "$data[0]\t$TAs_in_orf\t$out_string\n";
		$out_string = '';
		foreach($n_cont..$n_cont + $n_treat - 1) {
			$out_string .=  (join "\t", _unpack(\@counts_this_orf, $_, $_)) . "\t\t";
		}
		$out_string =~ s/\t\t$//;
		print DEBUG "\t$popTAs\t$out_string\n";
		###########################################################
		# get EV pVal for gap
		$gap = max_gap(\@EV_list);
		if ($TAs_in_orf < 4 || $gap < 4) {
			$EV_pVal = 1;
		} else {
			$R->set('phi', $phi);
			$R->set('n', $TAs_in_orf);
			$R->set('gap', $gap);
			$R->run(q`EV.p <- gumbel(phi, n, gap)`);
			$EV_pVal = $R->get('EV.p');
		}
		if ($popTAs) { # at least one TA hit in at least one library; print all info
			# stripping common zeros (affects only mean hits and diff, not sums and ratio)
			# diff = difference in mean hits/TA (treat - cont)
			$cont_sum = sum(_unpack(\@counts_this_orf, 0, $n_cont - 1));
			$treat_sum = sum(_unpack(\@counts_this_orf, $n_cont, $n_cont + $n_treat- 1));
			$log2_ratio = log( (($treat_sum + 1) / $n_treat) / (($cont_sum + 1) / $n_cont) ) / log(2);
			$diff = $log2_ratio; # resample on ratio
#			$diff = $treat_sum / ($popTAs * $n_treat) - $cont_sum / ($popTAs * $n_cont); # resampling on difference
			print OUT "$data[0]\t$data[1]\t$data[2]\t$data[3]\t$TAs_in_orf\t$popTAs\t$gap\t";
			foreach (@indx) {
				my @cnts = _unpack(\@counts_this_orf, $_, $_);
				print OUT sum(@cnts) / $popTAs . "\t";
			}
			print OUT $cont_sum / ($n_cont * $popTAs) . "\t" . $treat_sum / ($n_treat * $popTAs) . "\t$log2_ratio\n";
		}  else { # no populated TA; print info, set NA_flag
				print OUT "$data[0]\t$data[1]\t$data[2]\t$data[3]\t$TAs_in_orf\t0\t$gap\t";
				foreach (1..$n_all) { print OUT "0\t"; }
				print OUT "0\t0\tNA\n";
				$NA_flag = 1;
		}
	}
	### on to stats
	if ($NA_flag || $popTAs < 3) { # skip stats if no TAs in orf or < 3 TAs hit
		push @Pvals_EV, $EV_pVal;
		push @Pvals_resample, 'NA';
	} else { # process; don't bother with t test!
		push @Pvals_EV, $EV_pVal;
		### do resampling
		my @control_counts = _unpack(\@stripped_this_orf, 0, $n_cont - 1);
		my @treat_counts = _unpack(\@stripped_this_orf, $n_cont, $n_cont + $n_treat - 1);
		my $TAs1ref = \@control_counts;
		my $TAs2ref = \@treat_counts;
		$R->set('TAs1', $TAs1ref);
		$R->set('TAs2', $TAs2ref);
		$R->run(q`res <- resample(TAs1, TAs2)`);
		$R->run(q`q05 <- quantile(res, 0.05)`);
		$R->run(q`q95 <- quantile(res, 0.95)`);
		@resamples = @{ $R->get('res') };
		my $q05 = $R->get('q05');
		my $q95 = $R->get('q95');
		if ($diff < 0) { # this is a selected gene (treat < cont)
			$tail = true { $_ <= $diff } @resamples;
		} else { # this is an anti-selected gene (treat > cont)
			$tail = true { $_ >= $diff } @resamples;
		}
		if ($tail == 0) {
			push @Pvals_resample, 1 / 100000;
		} else {
			push @Pvals_resample, $tail / 10000;
		}
		# write R script for histogram
		&R_plot_resampled_diffs2("$basename\_R", $data[0], $diff, $q05, $q95, \@resamples);
	}
	$completed++;
	if ($completed % 100 == 0) {
		$time = localtime;
		print "$time\tcompleted $completed orfs\n";
	}
}
close OUT;
close TABLE;
close DEBUG;
if ($rejected_orfs) {
	print "$rejected_orfs orf(s) contained no TAs and were skipped\n";
}
#now get Qvals and append results to outputfile
print "computing Q values and writing results to $basename\_AllStats_$version\_out.txt...\n";
my (@Qvals_resample, @Qvals_EV);
my $arrayRef = get_qvals(\@Pvals_EV);
@Qvals_EV = @{$arrayRef};
$arrayRef = get_qvals(\@Pvals_resample);
@Qvals_resample = @{$arrayRef};
$R->stop(); #R no longer needed
#append results to outputfile
open OUT, ">$temptag.Qvals";
foreach (0..$#Pvals_EV) {
	print OUT "$Pvals_EV[$_]\t$Qvals_EV[$_]\t$Pvals_resample[$_]\t$Qvals_resample[$_]\n";
}
close OUT;
