sub _unpack { # returns array of counts; unpack(reference, first_indx, last_indx)
	my $ref = shift;
	my @array = @{$ref};
	my ($first, $last) = @_;
	my @counts;
	foreach my $index ($first..$last) {
		push @counts, @{$array[$index]};
	}
	return @counts;
}

sub max_gap { # finds longest run of zeros
	my $ref = shift;
	my @hits = @{ $ref };
	my ($gap, $max_gap, $new_max) = (0, 0, 0);
	foreach (@hits) {
		if ($_ == 0) {
			$gap += 1;
		} else {
			$new_max = $gap; # check for longer previous run
			if ($new_max > $max_gap) {
				$max_gap = $new_max;
			}
			$gap = 0;
		}
	}
	if ($gap > $max_gap) { # check to see of last gap is longer any previous max
		return $gap;
	} else {
		return $max_gap;
	}
}

sub get_qvals {
	my $p_ref = shift;
	$R->set('pvals', $p_ref);
	$R->run(q`qvals <- p.adjust(pvals, method="BH")`);
	my $q_ref = $R->get('qvals');
	return $q_ref;
}

sub volcano2 {
# revised for v9.3.3; plots Pvals, not Qvals
	my $datafile = shift; # Allstats output file
	my $colQval = shift; # Qval column
	my $colPval = $colQval - 1; #Pval column
	my $colRatio = $colQval - 4; # column of log2ratios
	my $label = 'resample';
	$datafile =~ /(.*)_AllStats_v/;
	my $basename = $1;
	# print R script
	open RSCRIPT, ">$basename.R";
	print RSCRIPT qq `data <- read.table("$datafile", header=T, row.names=1)\n`;
	print RSCRIPT qq `volcano <- function(data, name="RunID") {\n`;
	print RSCRIPT qq `\tratios <- data[,$colRatio]\n`;
	print RSCRIPT qq `\tlog.P <- -log10(data[,$colPval])\n`;
	print RSCRIPT qq `\tlog.Q <- -log10(data[,$colQval])\n`;
	print RSCRIPT qq `\tpdf(file="$basename\_volcano.pdf")\n`;
	print RSCRIPT qq `\tplot(ratios, log.P, pch=20, cex=0.5, main=name, xlab="log2(treatment/control)", ylab="-log(Pval)")\n`;
	print RSCRIPT qq `\tfilt <- log.Q > 1.301\n`;
	print RSCRIPT qq `\tpoints(ratios[filt], log.P[filt], pch=20, cex=0.5, col="red")\n`;
