	close RSCRIPT;
	# execute script
	system "R --vanilla < $basename.R > /dev/null";
	# delete script
	#unlink "$basename.R";
}

sub raw2igv2 {
# the previous version of this subroutine changed the names of the input count files,
# resulting in crashes if subsequent processing required to open those files
	my $ref = 'NC_018143.1';
	my $basename = shift;
	my @TAs; # list of TA coords
	system "paste @_ > $basename.temp1";
	open SUBIN, "$basename.temp1"
		or die "Can't open $basename.temp1 for reading ($!)\n";
	<SUBIN>; # header
	open SUBOUT, ">$basename\_raw.igv"
		or die "Can't open $basename.igv for writing ($!)\n";
	# print header
	my $time = localtime;
	print SUBOUT "# raw2igv.pl $time\n";
	print SUBOUT "# @_\n";
	print SUBOUT "Chromosome\tStart\tEnd\tFeature\t";
	foreach (@_) {print SUBOUT "counts_$_\t";}
	print SUBOUT "TAs\n";
	# now write the data
	my ($coord, @counts);
	while (<SUBIN>) {
		chomp;
		($coord, @counts) = split /\t/;
		push @TAs, $coord;
		print SUBOUT "$ref\t$coord\t", $coord + 1, "\tTA$coord\t";
		while (defined $counts[0]) {
			print SUBOUT "$counts[0]\t";
			shift @counts;
			shift @counts;
		}
		print SUBOUT "1\n";
	}
	close SUBOUT;
	close SUBIN;

	##### write normalized counts to IGV file
	# first get the data
	open SUBIN, "$basename\_normalized.txt"
		or die "Can't open $basename\_normalized.txt for reading ($!)\n";
	<SUBIN>; # header
	my %norm_counts; # stores counts for populated TAs
	while (<SUBIN>) {
		chomp;
		($coord, @counts) = split /\t/;
		$norm_counts{$coord} = [ @counts ];
	}
	close SUBIN;
	# now write the file
	open SUBOUT, ">$basename\_normalized.igv"
		or die "Can't open $basename\_normalized.igv for writing ($!)\n";
	# print header
	$time = localtime;
	print SUBOUT "# raw2igv.pl $time\n";
	print SUBOUT "# $basename normalized counts\n";
	print SUBOUT "Chromosome\tStart\tEnd\tFeature\t";
	my @new_names = @_; # required to avoid changing original count file names
	foreach (@new_names) {
		$_ =~ s/(.*)\./$1\_normalized./;
		print SUBOUT "$_\t";
	}
	print SUBOUT "TAs\n";
	# print data
	foreach my $this_TA (@TAs) {
		print SUBOUT "$ref\t$this_TA\t", $this_TA + 1, "\tTA$this_TA\t";
		if (exists $norm_counts{$this_TA}) {
			print SUBOUT join "\t", @{ $norm_counts{$this_TA} };
			print SUBOUT "\t1\n";
		} else {
			print SUBOUT "0\t0\t0\t0\t1\n";
		}
	}
	close SUBOUT;
	unlink "$basename.temp1";
}

sub R_plot_resampled_diffs2 { # R scripts for plotting
	my $dir = shift;
	my $orf = shift;
	my $target_diff = shift;
	my $q05 = shift;
	my $q95 = shift;
