	close FOR_R;
}

sub orf_count_table {
	# orf_count_table(count_files_ref, names_ref, table_file, basename)
	my $ref = shift;
	my @files = @{$ref};
	$ref = shift;
	my @names = @{$ref};
	my $table_file = shift;
	my $basename = shift;
	my $n_all = @files;
	# read table2 file; store TA lists in %TA_lists
	my %TA_lists;
	open SUBTABLE, "$table_file"
		or die "Problem opening $table_file ($!)\n";
	<SUBTABLE>; #throw away header
	while (<SUBTABLE>) {
		last if (/intergenic/);
		chomp;
		my @data = split /\t/;
		next if ($data[4] eq 'no TAs' || @data == 4); # no TAs in orf
		$TA_lists{$data[0]} = [ @data[4..$#data] ]; # reference to array of TAs
	}
	close SUBTABLE;
	my @orf_list = sort keys %TA_lists;
	# read each count file, sum counts for each ORF, store as array ref in %sums
	my %sums; # key = orf name, values = reference to array of sums
	# initialize %sums
	foreach (@orf_list) {
		$sums{$_} = [ ];
	}
	foreach my $this_file (@files) {
		open SUBIN, "$this_file" or die "Can't open $this_file! ($!)\n";
		<SUBIN>; # header
		my %counts = ();
		while (<SUBIN>) {
			chomp;
			my @line = split /\t/;
			$counts{$line[0]} = $line[1];
		}
		close SUBIN;
		foreach my $this_orf (@orf_list) {
			my @TAs = @{ $TA_lists{$this_orf} };
			my $sum = 0;
			foreach (@TAs) {
				$sum += $counts{$_};
			}
			push @{ $sums{$this_orf} }, $sum;
		}
	}
	open SUBOUT, ">$basename\_orf_counts.txt"
		or die "Can't open $basename\_orf_counts.txt for output! ($!)\n";
	print SUBOUT "ORF\t" , (join "\t", @names), "\n";
	foreach (@orf_list) {
		my $string = join "\t", @{ $sums{$_} };
		print SUBOUT "$_\t$string\n";
	}
	close SUBOUT;
	return "$basename\_orf_counts.txt";
}

sub ratio_hist3 {
	my $datafile = shift; # Allstats_v10 output file
	my $col = shift; # number of samples
	my $label = 'log2(ratio) Densities';
	$datafile =~ /(.*)_AllStats_v/;
	my $basename = $1;
	# print R script
	open RSCRIPT, ">$basename\_hist.R";
	print RSCRIPT qq `data <- read.table("$datafile", header=T, row.names=1)\n`;
	print RSCRIPT qq `col <- $col+9\n`;
	print RSCRIPT qq `raw <- density(data[,col],na.rm=T)\n`;
	print RSCRIPT qq `pdf(file="$basename\_ratio_histogram.pdf")\n`;
	print RSCRIPT qq `plot(raw, xlab='log2(treatment/control)', main="$basename $label")\n`;
	print RSCRIPT qq `abline(v=0, col="red")\n`;
	print RSCRIPT qq `center<-function(x){x<-x[x!=0];dens<-density(x,na.rm=T);max<-dens\$x[dens\$y==max(dens\$y)];max<-max(max);return(max)}\n`;
	print RSCRIPT qq `raw.max <- round(center(data[,col]), 3)\n`;
	print RSCRIPT qq `y.pos <- max(raw\$y)*0.75\n`;
	print RSCRIPT qq `x.pos <- min(raw\$x)\n`;
	print RSCRIPT qq `text(x.pos, y.pos, adj = c(0,0), bquote("ratio mode" == .(raw.max)))\n`;
	print RSCRIPT qq `dev.off()\n`;
	close RSCRIPT;
	# execute script
	system "R --vanilla < $basename\_hist.R > /dev/null";
	# delete script
	#unlink "$basename\_hist.R";
}

