		print RSCRIPT qq `qqplot(Input3, cnts, main="quantile-quantile plot for $name", xlab='Input-3 (reference)', ylab='$name', xlim=c(0,1000), ylim=c(0, 1000*slope), pch=16, cex=0.6)\n`;
#		print RSCRIPT qq `qqplot(Input3, cnts, main="quantile-quantile plot for $name", xlab='Input-3 (reference)', ylab='$name', xlim=c(0,1000), pch=16, cex=0.6)\n`;
		print RSCRIPT qq `abline(0, slope, col='red')\n`;
		print RSCRIPT qq `dev.off()\n`;
		close RSCRIPT;
		# execute script
		system "R --vanilla < $name\_qq.R > /dev/null";
		# move files into qq_plot directory
		system "mv $name\_qq.R $basename\_qq_plots/";
		system "mv $name\_qq_plot.pdf $basename\_qq_plots/";
	}
}
